    onSearchChange(event) {
      console.log(event);
    }

	render() {
		return (
		    <div className = 'tc'>
		    <h1> Your robo friends </h1>
		    <Searchbox searhChange= {this.onSearchChange} />
            <Cardlist robots= {this.state.robots} />
            </div>
		);
	};
};

export default App;
